script: |
  super -f text -I q7546.spq | sort > q7546.out

inputs:
  - name: q7546.spq
    data: |
      SELECT DISTINCT + col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT col1 * - col2 IN ( + col2 * - col0 / col2 );
  - name: tab0

outputs:
  - name: q7546.out
    data: |
      1
      33
      82
